import React from "react";
import Toolbar from "../../components/Toolbar";
import css from "./styles.module.css";
import BurgerBuilder from "../BurgerBuilder";

function App() {
  return (
    <div>
      <Toolbar />
      <main className="Content" style={{ marginTop: "60px" }}>
        <BurgerBuilder />
      </main>
    </div>
  );
}

export default App;
